I am new to typescript and I am trying to write a code that takes user input and then prints it. I am using the following code:
var input = readlineSync.question('Enter your name: ');
console.log('Hello ' + input + '!');
But I am getting the following error:
Error: Cannot find name 'readlineSync'.
I am using node.js and I have installed readline-sync using npm install readline-sync. I am not sure what I am doing wrong. Can someone please help me with this?
You need to import the module:
import * as readlineSync from 'readline-sync';
var input = readlineSync.question('Enter your name: ');
console.log('Hello ' + input + '!');
You can also use the following syntax:
import readlineSync from 'readline-sync';
var input = readlineSync.question('Enter your name: ');
console.log('Hello ' + input + '!');
Note that the second syntax is only supported in TypeScript 2.0 and above.
You can also use the following syntax:
import { question } from 'readline-sync';
var input = question('Enter your name: ');
console.log('Hello ' + input + '!');
